import React from 'react';
import { Link } from 'react-router-dom';
import './HomeMain.css';

const HomeMain = (props) =>{
    return (



<div className="HomeMain-wrapper">

            <h1>Trending News in Sports</h1>
            <div className="blog-post">
        <div className="blog-post_img">
            <img src="https://d18qs7yq39787j.cloudfront.net/uploads/contest/2130/small_pic_christopher-gower-m_HRfLhgABo-unsplash.jpg" alt=""/>
        </div>
        <div className="blog-post_info">
            <div className="blog-post_date">
                <span>Sunday</span>
                <span>October 27 2019</span>
            </div>
            <h1 className="blog-post_title">Shark Sighting</h1>
            <p className="blog-post_text">Lorem ipsum dolor sit amet consectetur adipisicing elit. Magnam maiores harum, praesentium repudiandae enim provident, nostrum atque animi rem delectus ullam facere vel. Consectetur inventore, aliquam itaque culpa explicabo corrupti, voluptatibus ea voluptates quibusdam ullam odio at repudiandae minus nesciunt, nemo incidunt nobis ipsum sit dolorem. Ullam non in possimus.</p>
            <a href="#" className="blog-post_cta">Read More</a>
        </div>
    </div>

            {
                props.clickable ? 
                <a rel="noopener noreferrer" href={props.image} target="_blank">
                    <img src={props.image} alt="image"/>
                </a>
                : <img src={props.image} alt="image"/>
            }
        </div>
    )
}

export default HomeMain;
